INSERT INTO `tbl_questions` (`question_id`, `exam_id`, `type`, `question`, `tag`, `option1`, `option2`, `option3`, `option4`, `answer`) VALUES
('QS-010101', 'EX-550055', 'MC', 'You are an account manager working with a high-valued client of your company. They are objecting to every advice and suggestions given by you during their onboarding. How would you handle this situation?', 'Account Setup and Management', 'Explain your suggestion in a polite and calm manner.\n', 'Listen to the objection before responding to it.', 'Dont force your views on the client when they are not in the right state of mind. Listen to the client peacefully and come back.', 'You may not be able to add value to a client who does not wish to listen. Report this client issue to the management and focus on other customers.', 'option3'),
('QS-010102', 'EX-550055', 'MC', 'An organisation\'s general expression of its overall purpose is known as its:', 'Business Intelligence', 'Objective', 'Vision', 'Goal', 'Mission\n', 'option4'),
('QS-010103', 'EX-550055', 'MC', 'A group of managers is considering pricing strategy and differentiation. At which level of strategy are the managers most likely to be working?', 'Research & Strategy', 'Corporate level', 'Business level', 'Mission and vision', 'Operational level', 'option2'),
('QS-010104', 'EX-550055', 'MC', 'During a negotiation discussion, what can be termed as unethical.', 'Negotiation & Persuasion skills', 'Misrepresentation', 'Inappropriate information collection', 'Bluffing', 'All of the given options.', 'option4'),
('QS-010105', 'EX-550055', 'MC', 'After you introduce yourself, what is the first thing you should say on a cold call when the prospect answers the phone?', 'Cold Calling', '\"How are you today?\"', '\"Do you have a few minutes to talk?\"', '\"Did I get you at a bad time?\"', '\"My company sells (mention product or service) and I\'d like to talk to you about ...\"', 'option1'),
('QS-010106', 'EX-550056', 'MC', ' Which of these is not mentioned in a tender?\n', 'Tender Management', 'Date', 'Notice number', 'Sign', 'Designation', 'option3'),
('QS-010107', 'EX-550056', 'MC', 'Why are construction companies using data and analytics?', 'Knowledge Management', 'To improve jobsite processes and productivity', 'Reduce risk and increase safety', 'Bid smarter and win more work', 'All of the above', 'option4'),
('QS-010108', 'EX-550056', 'MC', 'Where is the name of the company invited mentioned in an invitation of quotation?', 'Request For Quotation', 'Top left corner', 'Top right corner', 'Bottom left corner', 'Bottom right corner', 'option1'),
('QS-010109', 'EX-550056', 'MC', 'A safety programme on a construction site consists of', 'Process Knowledge', 'Three Es', 'Four Es', 'Five Es', 'Six Es', 'option2'),
('QS-010110', 'EX-550057', 'MC', 'You ask a coworker if they can help you with a client, they cross their arms and roll their eyes but do not say anything. Have they communicated?', 'Communication Skills', 'No, at this stage it is one-way communication', 'No, when they answer you they will have communicated back, completing two-way communication', 'No, but they are being rude', 'Yes, they have used non-verbal communication', 'option2'),
('QS-010111', 'EX-550057', 'MC', 'Ryan is working in his office and a client walks into your office and is exceedingly angry and difficult to talk to. How do you approach your client to make your meeting as productive as possible?', 'Organizational skills', 'You suggest that you both take a break and wait for your client to cool off.', 'In a stern voice, remind your client that there is an appropriate manner in which to speak to professionals and you expect to be treated accordingly.', 'You are already working and would reschedule the meeting.', 'Acknowledge that they are upset and ask them what is bothering them.', 'option4'),
('QS-010112', 'EX-550057', 'MC', ' Mary is a young and dynamic sales representative. She works for a consumer durables company in the US. During the client interactions, she diligently thanks her customers and shares her visiting cards.\nAfter every meeting, she shares minutes of the meeting with the client and succeeds it with a formal follow up. How can she further improve her sales interactions?\n', 'Decision Making and Logic Building', 'Mary can continue to remain formal and polite with the client throughout the meeting. No change is recommended.', 'Many sales interactions will require her to get to the items on the agenda quickly. In such cases, she can directly start with the agenda to save time.', 'In the current scenario, it is better to be flexible than structured. She can be more customer-centric, rather than process-centric.', 'Mary should be punctual in her meetings, and be specific about the agenda.\n', 'option3'),
('QS-010113', 'EX-550057', 'MC', 'Stewart is working with a retail giant in eastern Tokyo. Every week the team meets at 10 a.m. on Monday morning to discuss the progress of current open items and the plans for the next week. Martha is assigned to take notes, prepare minutes of the meeting, and keep track of open items. Stewart feels that this is a task for the team and should be done by all members in rotation every week. Which is the best way for Stewart to communicate his thoughts?\n', 'Team Coordination and Collaboration', 'I want all of us to handle this administrative task, turn by turn, and not burden Martha only', 'As we grow in the value chain, administrative tasks and project management becomes critical. I want each of us to steer weekly meetings on a rotating basis', 'Martha, you are doing a fantastic job. Can you assist us in developing these organizing skills? From now on, we should share the responsibility on a weekly rotating basis', 'I thank Martha for her hard work. It is not easy to steer meetings every week. I believe we all need to learn these skills. Let us start doing it turn by turn from next week.', 'option4'),
('QS-010114', 'EX-550058', 'MC', 'On an Excel sheet, the active cell is indicated by ____.\n', 'MS Excel', ' A dark wide border\n', 'A dotted border', 'A blinking border', 'None of the given options.', 'option1'),
('QS-010115', 'EX-550058', 'MC', 'What is the name of the feature that will allow you to take a step backward if you\'ve made a mistake?', 'MS Word', 'Redo', 'Cancel', 'Undo', 'We can do it by using Ctrl + x', 'option3'),
('QS-010116', 'EX-550058', 'MC', 'Which one among the following can only be done successfully if Outlook has online status:', 'MS Outlook', 'Creating an appointment', 'Scheduling a meeting', 'Creating an event', 'None of the given option', 'option2'),
('QS-010117', 'EX-550058', 'MC', 'Which of these apps is not included in the Office 365?', 'Office 365', 'MS Word', 'MS publisher', 'MS Excel', 'Powerpoint', 'option2');
